import React from 'react'

const Item = ({onClick, link}) => {
  const watch = () => {
    onClick(link)
  }

  return (
    <div className="row-item" onclick={watch}>
      <img src="kny.jpg" alt="poster"/>
    </div>
  )
}

export default Item
